## Fix for Trie.addWord (actual code changed is in TrieNode.addChild)

Currently when adding a substring of an existing word, the new word does not get marked as a complete word. Here's an example:

```js
const trie = new Trie();
trie.addWord('javascript');
trie.addWord('java');

trie.doesWordExist('java'); // returns false
```

This PR fixes the issue.

Way to replicate a bug in tests:

const minHeap = new MinHeap();

minHeap.add(5);
minHeap.add(3);
minHeap.add(2);

expect(minHeap.toString()).toBe('2,5,3');
minHeap.remove(3);
expect(minHeap.toString()).toBe('2,5');

minHeap.add(4);
minHeap.add(1);
minHeap.add(6);
expect(minHeap.toString()).toBe('1,2,4,5,6');

minHeap.remove(2);
expect(minHeap.toString()).toBe('1,5,4,6');

This is a Bidirectional Conditional Sort. 

Note on stability with custom compare function. 

```
let comp = new Comparator(function (a, b) {
    let x = a;
    let y = b;
    if (typeof a === "string") {
        x = a.length;
    }
    if (typeof b === "string") {
        y = b.length;
    }
    if (x === y) {
        return 0;
    }
    return x < y ? -1 : 1;
})
```


i.e. 
**Without**
a, cc, bbb --> a, bbb, cc
**With**
a, cc, bbb --> a, cc, bbb

Even with the custom compare, you are not always guaranteed a stable sort
Example: Given: [aa, q, a, bbbb, ccc] 
The algorithm will start with a SWAP from the right most index and the middle of the array.
1. START SWAP "ccc", "a"
END SWAP (New Array: aa,q,ccc,bbbb,a)
2. "aa" is greater than "a"
3. START SWAP "aa", "a"
END SWAP a,q,ccc,bbbb,aa
4. "ccc" is greater than "aa"
5. START INSRIGHT  (Given: a,q,bbbb,bbbb,aa)
END INSRIGHT (New Array: a,q,bbbb,aa,ccc)
6. "bbbb"is greater than "aa"
7. START INSRIGHT (Given: a,q,bbbb,aa,ccc)
END INSRIGHT  (New Array: a,q,aa,ccc,bbbb)

Finished:
[ 'a', 'q', 'aa', 'ccc', 'bbbb' ]

